Promotional info from Comicvine - &quot;Presenting a special Smurfs sampler comicbook from Papercutz with a full story in anticipation of the new series of graphic novels Papercutz will launch this fall!

When the evil sorcerer Gargamel wants to create a magic stone, he finds out that one of the ingredients in his recipe is a Smurf! Gargamel and his cat Azrael catch a very unlucky Smurf, who they plan to drop into their magic cauldron! It's up to Papa Smurf to lead a rescue effort to free their fellow Smurfs and foil Gargamel's plan.&quot;

This is the HD digital copy by Bean-Empire. Please seed, and enjoy. :-)

